import React from 'react'
class TodoRedux extends React.Component{
    constructor(props){
        super(props)
        this.state={
            name:''
        }
    }


    render(){
        return(
            <div>
                <input type="text"/>
                <button onClick={this.props.send(this.state.name)}>send to todo</button>
            </div>
        )
    }
}

export default TodoRedux
